// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./ReentrancyGuard.sol";
import "./Ownable.sol";
interface ITargetContract {
    function transferFrom(address from, address to,
        uint256 tokenId) external ;
    function transferSellOrder(uint256 proxy,address from, address to,uint256 tokenId) external ;

    function ownerOf(uint256 tokenId) external returns(address);
    function approve(address to, uint256 tokenId )external ;  
    function setApprovalForAll (address operator, bool approved) external;
    function updateSaleCounter(uint256 proxy, uint256 amount) external;
}
contract DaGamesMarketplace is ReentrancyGuard,Ownable {
    struct NftOnAuction {
        uint256 tokenId;
        address userAddress;
        uint256 startAmount;
        uint256 startDate;
        uint256 endDate;
        bool isStopped;
    }
    struct BidOnAuction {
        uint256 auctionId;
        uint256 bidDate;
        address fromUser;
        uint256 amount;
        bool accepted;
    }
    struct Sale {
        uint256 saleId;
        address seller;
        uint256 startDate;
        uint256 endDate;
        uint256 amount;
        bool status;
    }
    mapping(uint256 => address) public highestBider;
    mapping(uint256 => uint256) public highestBid;
    mapping(uint256 => NftOnAuction) public auctions;
    mapping(uint256 => BidOnAuction) public bids;
    mapping(uint256 => Sale) public sales;
    uint256 private proxyKey;
    address public avaContractAddress=0x001dB788405Ae02120704517d59A3161d8DE7111;

    address private _admin=0xaA89b450b023763f5B30a4326681Da0D13930e2d;
    uint256 private _currentAuction = 1;
    uint256 private _currentBid = 1;
    uint256 private _currentSaleId = 1;
    event AuctionList(
        uint256 auctionId,
        uint256 tokenId,
        address byUser,
        uint256 startAmount,
        uint256 startDate,
        uint256 endDate
    );

    event Bid(
        uint256 auctionId,
        uint256 bidDate,
        address fromUser,
        uint256 amount
    );
    event StartSale(
        uint256 saleId,
        uint256 startDate,
        uint256 endDate,
        uint256 amount,
        bool status
    );

    constructor() {}
    function setProxyKey(uint256 proxy)external onlyOwner{
        proxyKey=proxy;
    }
    function addAuction( uint256 tokenId,uint256 startAmount,uint256 startDate,uint256 endDate) public{
        auctions[tokenId] = NftOnAuction(
                tokenId,
                msg.sender,
                startAmount,
                startDate,
                endDate,
                false
            );
            highestBid[tokenId]=startAmount;
            highestBider[tokenId]=msg.sender;
            emit AuctionList(
                _currentAuction,
                tokenId,
                msg.sender,
                startAmount,
                startDate,
                endDate
            );
            _currentAuction++;
    }
    function addSale(uint256 tokenId,uint256 startDate,uint256 endDate,uint256 startAmount)public{

        sales[tokenId] = Sale(
                _currentSaleId,
                msg.sender,
                startDate,
                endDate,
                startAmount,
                false
            );
             emit StartSale(
                _currentSaleId,
                startDate,
                endDate,
                startAmount,
                false
            );
            _currentSaleId++;
    }
    function addBid(

        uint256 auctionId,
        uint256 amount
    ) public {
        bids[_currentBid] = BidOnAuction(
            auctionId,
            block.timestamp,
            msg.sender,
            amount,
            false
        );
        _currentBid++;
        emit Bid(auctionId, block.timestamp, msg.sender, amount);
    }

    function stopSale(address collectionContract,uint256 tokenId) public returns (bool) {
        require(sales[tokenId].seller == msg.sender);
        ITargetContract avaContract=getSmartContract(collectionContract);
        avaContract.transferSellOrder(proxyKey, address(this), sales[tokenId].seller, tokenId);
        sales[tokenId].status = true;
        return true;
    }

    function getSaleAmount(uint256 tokenId) public returns (uint256) {
        return sales[tokenId].amount;
    }

    function checkIfSaleRunning(uint256 tokenId) public returns (bool) {
        return sales[tokenId].status;
    }

    function stopAuction(uint256 tokenId) internal returns (bool) {
        require(auctions[tokenId].userAddress == msg.sender, "Invalid User");
        auctions[tokenId].isStopped = false; 
        return true;
    }

    function getTokenIdFromAuction(uint256 tokenId) public returns (uint256) {
        return auctions[tokenId].tokenId;
    }

    function checkIfAuctionRunning(uint256 tokenId) public returns (bool) {
        return auctions[tokenId].isStopped;
    }

    function getUserAddressFromAuction(uint256 tokenId)
        public
        returns (address)
    {
        return auctions[tokenId].userAddress;
    }

    function getAuctionStartAmount(uint256 auctionId) public returns (uint256) {
        return auctions[auctionId].startAmount;
    }

  function cancelAuction(uint256 tokenId) public returns(bool){
       require(
            checkIfAuctionRunning(tokenId) == false,
            "not stopped"
        );
        require(highestBider[tokenId]==msg.sender,"Can't cancel auction");
        require(auctions[tokenId].userAddress==msg.sender,"NA");
        auctions[tokenId].isStopped=true;
        highestBid[tokenId]=0; 
        return true;
  }
    function claimAuctionItem(address collectionContract,uint256 tokenId) public payable {
        require(
            checkIfAuctionRunning(tokenId) == true,
            "not stopped"
        );
        require(highestBider[tokenId] == msg.sender, " not higest bidder"); //TBD
        require(highestBid[tokenId] == msg.value, "Invalid Amount");
        ITargetContract avaContract=getSmartContract(collectionContract);
        address seller = avaContract.ownerOf(getTokenIdFromAuction(tokenId));
        avaContract.transferFrom(seller, msg.sender, getTokenIdFromAuction(tokenId));
    }
    function getSmartContract(address scAddress) private returns (ITargetContract){
         ITargetContract targetContract = ITargetContract(address(scAddress));
         return targetContract;
    }


    function startListing(
        uint256 tokenId,
        uint256 startAmount,
        uint256 auctionType,
        uint256 startDate,
        uint256 endDate
    ) external {


        _startListing(tokenId, startAmount, auctionType, startDate, endDate);
    }

    function _startListing(
        uint256 tokenId,
        uint256 startAmount,
        uint256 auctionType,
        uint256 startDate,
        uint256 endDate
    ) internal virtual {
         ITargetContract avaContract=getSmartContract(avaContractAddress);

        require(avaContract.ownerOf(tokenId) == msg.sender, "not owner");
        if (auctionType == 1) {
            addSale(tokenId, startDate, endDate, startAmount);

            avaContract.transferSellOrder(proxyKey, msg.sender, address(this), tokenId);
        } else {

            addAuction(tokenId, startAmount, startDate, endDate);
        }
    }

    function bid(uint256 auctionId, uint256 amount) public {
        _bid(auctionId, amount);
    }
    function _bid(uint256 auctionId, uint256 amount) internal virtual {
        require(checkIfAuctionRunning(auctionId) == false, "stopped"); 
        require(amount >= getAuctionStartAmount(auctionId) , "Invalid");
        require(amount > highestBid[auctionId], "not greater bid");
        require(auctions[auctionId].userAddress!=msg.sender,"You can't bid on your nft");
        highestBid[auctionId] = amount;
        highestBider[auctionId] = payable(msg.sender);
        addBid(auctionId, amount);

    }
    function claimItem(address collectionContract, uint256 tokenId) public payable{
       ITargetContract avaContract=getSmartContract(collectionContract);
        require(highestBider[tokenId]==msg.sender,"can't access");
        require(highestBid[tokenId]==msg.value,"Invalid Amount"); 
        if(collectionContract==avaContractAddress){ 
            payable(auctions[tokenId].userAddress).transfer(msg.value*95/100);
            payable(avaContractAddress).transfer(msg.value*35/1000);
            avaContract.updateSaleCounter(proxyKey, msg.value*35/1000);
        }
        else{
            payable(auctions[tokenId].userAddress).transfer(msg.value*97/100);
            payable(avaContractAddress).transfer(msg.value*15/1000);
            avaContract.updateSaleCounter(proxyKey, msg.value*15/1000);
        }
        payable(_admin).transfer(msg.value*15/1000);
        avaContract.transferSellOrder(proxyKey, address(this), msg.sender, tokenId);

    }
    function finalizeAuction(address collectionContract,uint256 auctionId) public{
        _finalizeAuction(collectionContract, auctionId);
    }
    function _finalizeAuction(address collectionContract,uint256 auctionId) internal virtual {
           ITargetContract avaContract=getSmartContract(collectionContract);
        require(checkIfAuctionRunning(auctionId) == false, "stopped");
        require(
            getUserAddressFromAuction(auctionId) == msg.sender,
            "no"
        );
      stopAuction(auctionId);
    if(highestBider[auctionId]!=msg.sender){

        avaContract.transferSellOrder(proxyKey, msg.sender,address(this), auctionId);
        }

    }
    function getNftOwner(uint256 tokenId) external returns(address){
         ITargetContract avaContract=getSmartContract(avaContractAddress);

        address seller = avaContract.ownerOf(tokenId);
        return seller;
    }
    function buyNft(address collectionContract,uint256 tokenId) public payable nonReentrant {
         require(checkIfSaleRunning(tokenId) == false, "No Sale");
          ITargetContract avaContract=getSmartContract(collectionContract);

        address seller = sales[tokenId].seller;
        address newOwner=msg.sender;
        require(seller != msg.sender, "owned");

        require(getSaleAmount(tokenId) == msg.value, "Invalid Amount");
           sales[tokenId].status = true;

        if(collectionContract==avaContractAddress){ 
            payable(sales[tokenId].seller).transfer(msg.value*95/100);

           payable( avaContractAddress).transfer(msg.value*35/1000);
          avaContract.updateSaleCounter(proxyKey, msg.value*35/1000);
        }
        else{
            payable(sales[tokenId].seller).transfer(msg.value*97/100);
            payable(avaContractAddress).transfer(msg.value*15/1000);
           avaContract.updateSaleCounter(proxyKey, msg.value*15/1000);
        }
        payable(_admin).transfer(msg.value*15/1000);

        avaContract.transferSellOrder(proxyKey, address(this), newOwner, tokenId);

    }
    function cancelClaim(address collectionContract, uint256 tokenId) external{
        require(auctions[tokenId].userAddress==msg.sender,"Invalid Attempt");
          ITargetContract avaContract=getSmartContract(collectionContract);
          address smartContractOwnerAddress = avaContract.ownerOf(getTokenIdFromAuction(tokenId));
          require(smartContractOwnerAddress==address(this),"Can't Transfer");
           avaContract.transferSellOrder(proxyKey, address(this), msg.sender, tokenId);
    }   


